const TreeItem = ({ item }) => {
  const onExpandHandler = () => {

    console.log("clicked!");
    return <TreeList list={item.children} />;
  };

  return (
    <div>
      <div>{item.label}</div>
      <div onClick={onExpandHandler}>{item.children ? " + " : null}</div>
    </div>
  );
};

export default TreeItem;
